    <style>
      #scrolly {
        position: relative;
        padding: 1rem;
      }

      .scrolly-overlay {
        position: relative;
        padding: 0;
        max-width: 35rem;
        margin: 0 auto;
      }

      .sticky-thing {
        position: -webkit-sticky;
        position: sticky;
        left: 0;
        width: 100%;
        margin: 0;
        z-index: 0;
        top: 0;
        height: 100vh;
        /* Center everything inside */
        display: flex;
        justify-content: center;
        flex-direction: column;
        justify-content: center;
      }

      .step {
        margin: 0 auto 2rem auto;
        margin-bottom: 25rem;
        /* background-color: white;
        color: black;
        border: 3px solid white; */
      }

      .step p {
        text-align: center;
        padding: 1rem;
        font-size: 1.25rem;
        /* border: black;
        border: 3px solid goldenrod; */
      }

      .hidden { visibility: hidden; }

      /* When it's less than 700 pixels wide, do normal scrollytelling */
      @media only screen and (min-width: 700px) {
        #scrolly.side-by-side {
          display: flex;
        }

        #scrolly.side-by-side > div {
          flex-basis: 0;
          flex-grow: 1;
          flex-shrink: 1;
          padding: 0.75em;
        }

        #scrolly.side-by-side .scrolly-overlay {
          margin-top: 70vh;
          order: 0;
          /* Change these to adjust sizing options */
          min-width: 15rem;
          max-width: 20rem;
        }

        #scrolly.side-by-side .sticky-thing {
          order: 1;
          flex-grow: 2;
        }
      }
    </style>

<!-- ai2html resizer script -->

<script type="text/javascript">
(function() {
// only want one resizer on the page
if (document.documentElement.className.indexOf("g-resizer-v3-init") > -1) return;
document.documentElement.className += " g-resizer-v3-init";
// require IE9+
if (!("querySelector" in document)) return;
function resizer() {
  var elements = Array.prototype.slice.call(document.querySelectorAll(".g-artboard[data-min-width]")),
      widthById = {};
  elements.forEach(function(el) {
      var parent = el.parentNode,
          width = widthById[parent.id] || parent.getBoundingClientRect().width,
          minwidth = el.getAttribute("data-min-width"),
          maxwidth = el.getAttribute("data-max-width");
      widthById[parent.id] = width;

      if (+minwidth <= width && (+maxwidth >= width || maxwidth === null)) {
          el.style.display = "block";
      } else {
          el.style.display = "none";
      }
  });
  try {
      if (window.parent && window.parent.$) {
          window.parent.$("body").trigger("resizedcontent", [window]);
      }
      if (window.require) {
          require(['foundation/main'], function() {
              require(['shared/interactive/instances/app-communicator'], function(AppCommunicator) {
                  AppCommunicator.triggerResize();
              });
          });
      }
  } catch(e) { console.log(e); }
}

document.addEventListener('DOMContentLoaded', resizer);
// feel free to replace throttle with _.throttle, if available
window.addEventListener('resize', throttle(resizer, 200));        

function throttle(func, wait) {
  // from underscore.js
  var _now = Date.now || function() { return new Date().getTime(); },
      context, args, result, timeout = null, previous = 0;
  var later = function() {
      previous = _now();
      timeout = null;
      result = func.apply(context, args);
      if (!timeout) context = args = null;
  };
  return function() {
      var now = _now(), remaining = wait - (now - previous);
      context = this;
      args = arguments;
      if (remaining <= 0 || remaining > wait) {
          if (timeout) {
              clearTimeout(timeout);
              timeout = null;
          }
          previous = now;
          result = func.apply(context, args);
          if (!timeout) context = args = null;
      } else if (!timeout && options.trailing !== false) {
          timeout = setTimeout(later, remaining);
      }
      return result;
  };
}


})();
</script>
